'''Agribank Cup 2007''' diễn ra từ ngày 1 tháng 11 đến ngày 5 tháng 11 năm 2007.

Đây cũng là mùa giải giao hữu quốc tế cuối cùng [[Ngân hàng Nông nghiệp và Phát triển Nông thôn Việt Nam]] (Agribank) là nhà tài trợ chính, từ mùa giải sau tên Agribank Cup không còn nữa.

==Địa điểm thi đấu==
Tất cả các trận đấu diễn ra tại [[Sân vận động Quốc gia Mỹ Đình]], [[Hà Nội]], [[Việt Nam]].

